- proto: Paper
  entities:
  - uid: 18708
    components:
    - type: Transform
      pos: 9.23041,106.35197
      parent: 2
    - type: Paper
      content: >
        -Запись 1

        Я как Администратор новой шахтной зоны "Хоксес" вхожу на свой пост. Мои шахтёры начинают раскопки в поисках материалов. Первое сканирование местности дало достаточно хорошую надежду на поиск богатых жил.

        -Запись 2

        Мы введём раскопки. Мы нашли первую достаточно хорошую жилу Сталеносной руды, но усложняет ситуацию то, что порода горы оказалось слишком твёрдой и требуется более улучшенные буровые установки.

        -Запись 3

        Мы обнаружили достаточно богатые жилы Плазмы, Урана, Золота и Серебра. Правда проблема в том, что она за прослойкой твёрдой породы, поэтому нам придётся использовать скорее всего ядерную боеголовку. Вскоре нам её доставят.

        -Запись 4

        Боеголовка прибыла. Исследователи зафиксировали достаточно большие встряски поверхности, вскоре это может привести к обвалам.

        -Запись 5

        Произошло пару несколько обвалов. Они не критичны и не перекрыли ничего важного. В некоторых участках появлялись неизвестные создания, они были уничтожены СБ.

        -Запись 6

        Это КСЕНОМОРФЫ!!! Их пока не слишком много, но встряски увеличились.

        -Запись 7

        Их слишком много... Произошло мини землетрясение, порода обвалилась... Мы обречены...

        -Запись ... 8?

        Я закрылся в своём офисе... Большинство моих работников погибли... Я запросил помощь у войск... Надеюсь я до них доживу...
